import React from 'react';
import './App.css';

import {Container, Row} from "react-bootstrap";

import NavigationBar from "./components/NavigationBar";

function App() {
  return (
    <div className="App">
        <NavigationBar/>
        <Container>
            <Row>

            </Row>
        </Container>
        <p>
        Welcome to our hotels!
        </p>
    </div>
  );
}

export default App;
